    <script>

        var states = ["#ebedf0", "#9be9a8", "#40c463", "#30a14e", "#216e39"];
        var mouseIsDown = false;

        function IncrementState(item) {
            var currentState = $(item).attr("fill");
            var currentStateIndex = states.indexOf(currentState);
            var newStateIndex = currentStateIndex + 1;
            if(newStateIndex >= states.length) {
                newStateIndex = 0;
            }
            var newState = states[newStateIndex];
            $(item).attr( { "fill" : newState } );
        }

        $(document).ready(function() {

            $(document).mousedown(function() {
                mouseIsDown = true;
            });
            $(document).mouseup(function() {
                mouseIsDown = false;
            });

            $("rect").mouseover(function() {
                if(mouseIsDown) {
                    IncrementState(this);
                }
            });
            $("rect").click(function() {
                IncrementState(this);
            })

            $(".set-blank-trigger").click(function(event) {
                $("rect").attr( { "fill" : states[0] });
            });
        });
    </script>
